def find_mixmatch_pos(pattern,text,d):
    match_indices = []
    for i in range(0,len(text)-len(pattern)+1):
        word = text[i:i+len(pattern)]
        dist = calc_dist(word,pattern)
        if dist <= d:
            match_indices.append((i,dist))
    return  match_indices


